@onegrandbooks invited me to curate a bookshelf of my 10 desert-island-level faves. I loved making this even though my first pass was 34 books long and cutting it down felt moderately sacrilegious. 

Head to One Grand to read the full list and order books from an independent bookseller as the good lord intended ❤️

(And thanks to @neilarrr, who introduced the YOU writers’ room to @jiatortellini’s book.)
